    y[0] = x[0]*28.013400*XWinv; 
    y[1] = x[1]*39.948000*XWinv; 
    y[2] = x[2]*1.007970*XWinv; 
    y[3] = x[3]*31.998800*XWinv; 
    y[4] = x[4]*17.007370*XWinv; 
