    y[21] = x[21]*30.070120*XWinv; 
    y[22] = x[22]*13.019120*XWinv; 
    y[23] = x[23]*26.038240*XWinv; 
    y[24] = x[24]*27.046210*XWinv; 
    y[25] = x[25]*43.045610*XWinv; 
    y[26] = x[26]*44.053580*XWinv; 
    y[27] = x[27]*42.037640*XWinv; 
