    result += y[9]*ums[9]*imw[9]; /*H2O2 */
    result += y[10]*ums[10]*imw[10]; /*CO */
    result += y[11]*ums[11]*imw[11]; /*CO2 */
    result += y[12]*ums[12]*imw[12]; /*HCO */
    result += y[13]*ums[13]*imw[13]; /*CH2O */
    result += y[14]*ums[14]*imw[14]; /*CH4 */
    result += y[15]*ums[15]*imw[15]; /*CH3 */
    result += y[16]*ums[16]*imw[16]; /*T-CH2 */
    result += y[17]*ums[17]*imw[17]; /*S-CH2 */
    result += y[18]*ums[18]*imw[18]; /*C2H4 */
    result += y[19]*ums[19]*imw[19]; /*CH3O */
    result += y[20]*ums[20]*imw[20]; /*C2H5 */
    result += y[21]*ums[21]*imw[21]; /*C2H6 */
    result += y[22]*ums[22]*imw[22]; /*CH */
    result += y[23]*ums[23]*imw[23]; /*C2H2 */
    result += y[24]*ums[24]*imw[24]; /*C2H3 */
    result += y[25]*ums[25]*imw[25]; /*CH2CHO */
    result += y[26]*ums[26]*imw[26]; /*C2H4O */
    result += y[27]*ums[27]*imw[27]; /*CH2CO */
    result += y[28]*ums[28]*imw[28]; /*HCCO */
    result += y[29]*ums[29]*imw[29]; /*C2H */
    result += y[30]*ums[30]*imw[30]; /*CH2OH */
    result += y[31]*ums[31]*imw[31]; /*CH3OH */
    result += y[32]*ums[32]*imw[32]; /*C3H4 */
    result += y[33]*ums[33]*imw[33]; /*C3H3 */
