    YOW += y[8]*imw[8]; /*HO2 */
    YOW += y[9]*imw[9]; /*H2O2 */
    YOW += y[10]*imw[10]; /*CO */
    YOW += y[11]*imw[11]; /*CO2 */
    YOW += y[12]*imw[12]; /*HCO */
    YOW += y[13]*imw[13]; /*CH2O */
    YOW += y[14]*imw[14]; /*CH4 */
    YOW += y[15]*imw[15]; /*CH3 */
    YOW += y[16]*imw[16]; /*T-CH2 */
    YOW += y[17]*imw[17]; /*S-CH2 */
    YOW += y[18]*imw[18]; /*C2H4 */
    YOW += y[19]*imw[19]; /*CH3O */
    YOW += y[20]*imw[20]; /*C2H5 */
    YOW += y[21]*imw[21]; /*C2H6 */
    YOW += y[22]*imw[22]; /*CH */
    YOW += y[23]*imw[23]; /*C2H2 */
    YOW += y[24]*imw[24]; /*C2H3 */
    YOW += y[25]*imw[25]; /*CH2CHO */
    YOW += y[26]*imw[26]; /*C2H4O */
    YOW += y[27]*imw[27]; /*CH2CO */
    YOW += y[28]*imw[28]; /*HCCO */
    YOW += y[29]*imw[29]; /*C2H */
    YOW += y[30]*imw[30]; /*CH2OH */
    YOW += y[31]*imw[31]; /*CH3OH */
    YOW += y[32]*imw[32]; /*C3H4 */
    YOW += y[33]*imw[33]; /*C3H3 */
    YOW += y[34]*imw[34]; /*C3H5 */
    YOW += y[35]*imw[35]; /*C3H6 */
    YOW += y[36]*imw[36]; /*C3H8 */
    YOW += y[37]*imw[37]; /*I-C3H7 */
    YOW += y[38]*imw[38]; /*N-C3H7 */
    /*Now compute y to x conversion */
    x[0] = y[0]/(28.013400*YOW); 
    x[1] = y[1]/(39.948000*YOW); 
    x[2] = y[2]/(1.007970*YOW); 
    x[3] = y[3]/(31.998800*YOW); 
    x[4] = y[4]/(17.007370*YOW); 
    x[5] = y[5]/(15.999400*YOW); 
    x[6] = y[6]/(2.015940*YOW); 
    x[7] = y[7]/(18.015340*YOW); 
    x[8] = y[8]/(33.006770*YOW); 
    x[9] = y[9]/(34.014740*YOW); 
    x[10] = y[10]/(28.010550*YOW); 
    x[11] = y[11]/(44.009950*YOW); 
    x[12] = y[12]/(29.018520*YOW); 
    x[13] = y[13]/(30.026490*YOW); 
    x[14] = y[14]/(16.043030*YOW); 
    x[15] = y[15]/(15.035060*YOW); 
    x[16] = y[16]/(14.027090*YOW); 
    x[17] = y[17]/(14.027090*YOW); 
