    kc[29] = exp((g_RT[2] + g_RT[3]) - (g_RT[4] + g_RT[5]));

    /*reaction 31: H2 + O <=> OH + H */
    kc[30] = exp((g_RT[6] + g_RT[5]) - (g_RT[4] + g_RT[2]));

    /*reaction 32: H2 + OH <=> H2O + H */
    kc[31] = exp((g_RT[6] + g_RT[4]) - (g_RT[7] + g_RT[2]));

    /*reaction 33: H2O + O <=> 2 OH */
    kc[32] = exp((g_RT[7] + g_RT[5]) - (2 * g_RT[4]));

    /*reaction 34: H2 + O2 <=> 2 OH */
    kc[33] = exp((g_RT[6] + g_RT[3]) - (2 * g_RT[4]));

    /*reaction 35: HO2 + H <=> 2 OH */
    kc[34] = exp((g_RT[8] + g_RT[2]) - (2 * g_RT[4]));

    /*reaction 36: HO2 + H <=> H2 + O2 */
    kc[35] = exp((g_RT[8] + g_RT[2]) - (g_RT[6] + g_RT[3]));

    /*reaction 37: HO2 + H <=> H2O + O */
    kc[36] = exp((g_RT[8] + g_RT[2]) - (g_RT[7] + g_RT[5]));

    /*reaction 38: HO2 + O <=> OH + O2 */
    kc[37] = exp((g_RT[8] + g_RT[5]) - (g_RT[4] + g_RT[3]));

    /*reaction 39: HO2 + OH <=> H2O + O2 */
    kc[38] = exp((g_RT[8] + g_RT[4]) - (g_RT[7] + g_RT[3]));

    /*reaction 40: 2 HO2 <=> H2O2 + O2 */
    kc[39] = exp((2 * g_RT[8]) - (g_RT[9] + g_RT[3]));

    /*reaction 41: H2O2 + H <=> HO2 + H2 */
    kc[40] = exp((g_RT[9] + g_RT[2]) - (g_RT[8] + g_RT[6]));

    /*reaction 42: H2O2 + H <=> H2O + OH */
    kc[41] = exp((g_RT[9] + g_RT[2]) - (g_RT[7] + g_RT[4]));

