    kc[42] = exp((g_RT[9] + g_RT[4]) - (g_RT[7] + g_RT[8]));

    /*reaction 44: H2O2 + O <=> HO2 + OH */
    kc[43] = exp((g_RT[9] + g_RT[5]) - (g_RT[8] + g_RT[4]));

