    kc[44] = exp((g_RT[10] + g_RT[4]) - (g_RT[11] + g_RT[2]));

    /*reaction 46: CO + HO2 <=> CO2 + OH */
    kc[45] = exp((g_RT[10] + g_RT[8]) - (g_RT[11] + g_RT[4]));

    /*reaction 47: HCO + H <=> CO + H2 */
    kc[46] = exp((g_RT[12] + g_RT[2]) - (g_RT[10] + g_RT[6]));

    /*reaction 48: HCO + O <=> CO + OH */
    kc[47] = exp((g_RT[12] + g_RT[5]) - (g_RT[10] + g_RT[4]));

    /*reaction 49: HCO + O <=> CO2 + H */
    kc[48] = exp((g_RT[12] + g_RT[5]) - (g_RT[11] + g_RT[2]));

    /*reaction 50: HCO + OH <=> CO + H2O */
